function App( ) {
  const [selectedUser, setSelectedUser] = useState("");



  return (
    <div className="App">
        <Router>
      <header className="App-header">Natter
          <Nav />
      </header>
      <main>
          <Switch>
            <Route path="/buzzwords">
              <Buzzwords />
            </Route>
            <Route path="/nats">
              <Nats handleUserClick={setSelectedUser} />
            </Route>

            <Route path="/profile/:username">
              <Profile username={selectedUser} />
            </Route>
          </Switch>
      </main>
        </Router>
    </div>
  );
}

export default App;
